import React, {Component} from 'react';
import './layout.css';

class Menu extends Component{
  render(){
    return(
      <div className="MuiDrawer-root MuiDrawer-docked"> 
        <div className="MuiPaper-root MuiDrawer-paper jss320 MuiDrawer-paperAnchorLeft MuiDrawer-paperAnchorDockedLeft MuiPaper-elevation0">
        <div class="jss314">
            <button class="MuiButtonBase-root MuiIconButton-root" tabindex="0" type="button">
              <span class="MuiIconButton-label">
                <svg class="MuiSvgIcon-root" focusable="false" viewBox="0 0 24 24" aria-hidden="true" role="presentation">
                  <path d="M15.41 7.41L14 6l-6 6 6 6 1.41-1.41L10.83 12z"></path>
                </svg>
              </span>
              <span class="MuiTouchRipple-root"></span>
            </button>
          </div>
        <hr class="MuiDivider-root" />

        </div>
      </div>
    );
  }
}

export default Menu;
